package Collections;

import java.util.Stack;

public class StackPractice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Stack<Integer> s1 = new Stack<Integer>();
		
		s1.add(1); 
		s1.add(2);
		s1.add(3);
		s1.add(4);
		
		
		s1.push(3);
		
	
		
		System.out.println(s1.peek());
		
		

	}

}
